import { useFetch } from './hooks/useFetch';
import { ICharacterCardProps ,CharacterCard } from './components/CharacterCard';

function App() {

  const { loading, error, data } = useFetch('https://rickandmortyapi.com/api/character/?page=1')

  const character = data?.results as ICharacterCardProps[]

  if (loading) return <p>Loading...</p>
  if(error) return <p>Error!</p>

  return (
    <div className="App">
      {character?.map(character =>
        <CharacterCard
          name={character.name}
          species={character.species}

        />

      )}

    </div>
  );
}

export default App;
